import React from "react";
export const Footer = () => {
  let footerStyle = {
    position: "relative",
    top: "70vh",
    width: "100%",
    border: "2px solid black"
  };

  return (
    <footer className="bg-dark text-light py-3" style={footerStyle}>
      <p className="text-center">
                    Footer Content &copy; {new Date().getFullYear()} | All rights reserved
      </p>
    </footer>
  )
}
